export function tokenLoader(){
    return getAuthToken();
}

export function getAuthToken(){
    const token = localStorage.getItem("ACCESS_TOKEN");
    console.log("확인" + token)
    if(token==null || !token){
        return undefined;
    }
    return token;
}
